// store.js
import { configureStore } from '@reduxjs/toolkit';
import FormsReducer from './Reducers/AcademicReducer';
import genericReducer from './Reducers/genericReducers';
import rootReducer from './Reducers';

const store = configureStore({
  reducer: rootReducer,
});

export default store;
